//SPDX-License-Identifier: MIT

pragma solidity >=0.4.22 <0.9.0;

import "./Ownable.sol";
import "./Rack.sol";
    
contract Main is Ownable{
    
    uint companyCost = 1 ether;
    uint customerCost = 1 ether;
    uint rackCost = 1 ether;

    
    struct S_Companies{
        address _owner;
        uint _when;
        mapping(uint => S_Customer) _customer;
        uint _customerIndex;
    }

    struct S_Customer{
        string _name;
        mapping(uint => S_WhereRack) _rack;
        uint _rackIndex;
        bool _created;
    }
    
    struct S_WhereRack{
        string _name;
        address _where;
        string _pincode;
    }
    
    mapping(address => S_Companies) private company;

    uint private companiesIndex;
    uint private customerIndex;
    uint private rackIndex;

    bool private isPayable;
    
    event companyCreated(address _address);
    event customerCreated(address _address);
    event rackCreated(address _address);
    event priceUpdated(uint _newPrice);
    event withdrawStatus(string _status);
    
    function createCompany() payable public {
        address msgSender = _msgSender();
        require(msg.value == companyCost, "only full payments allowed");
        require(msgSender != company[msgSender]._owner, "One Company Per Wallet");
        company[msgSender]._owner = msgSender;
        company[msgSender]._when = block.timestamp;

        (bool success, ) = owner().call{value: companyCost}("");
        require(success, "Transfer failed.");

        companiesIndex ++;
        emit companyCreated(msgSender);
    }
    
    // Add a customer 
    function addCustomer(string memory _name) public payable {
        address msgSender = _msgSender();
        require(msgSender == company[msgSender]._owner, "Company not created");
        require(msg.value == customerCost,"Full Payments Only");
        company[msgSender]._customer[company[msgSender]._customerIndex]._name = _name;

        (bool success, ) = owner().call{value: customerCost}("");
        require(success, "Transfer failed.");

        company[msgSender]._customer[company[msgSender]._customerIndex]._created = true;
        company[msgSender]._customerIndex ++ ;
        customerIndex ++;
        emit customerCreated(msgSender);
    }

    // Add a rack
    function addRack(uint _id, string memory _name, string memory _pin) public payable{
        address msgSender = _msgSender();
        require(msgSender == company[msgSender]._owner, "Not the owner");
        require(company[msgSender]._customer[_id]._created == true,"Customer not created");
        require(msg.value == rackCost,"Full Payments Only");
        
        Rack rack = new Rack(msgSender, _name);
        company[msgSender]._customer[_id]._rack[company[msgSender]._customer[_id]._rackIndex]._name = _name;
        company[msgSender]._customer[_id]._rack[company[msgSender]._customer[_id]._rackIndex]._where = address(rack);
        company[msgSender]._customer[_id]._rack[company[msgSender]._customer[_id]._rackIndex]._pincode = _pin;

        (bool success, ) = owner().call{value: rackCost}("");
        require(success, "Transfer failed.");

        company[msgSender]._customer[_id]._rackIndex ++ ;
        rackIndex ++;
        emit rackCreated(msgSender);
    }
    
    receive() external payable {
        
    }
    
    fallback() external {
        
    }

    /********* Owner Only *********/

    function updateCompanyPrice(uint _price) public onlyOwner{
        companyCost = _price;
        emit priceUpdated(companyCost);
    }

    function updateCustomerPrice(uint _price) public onlyOwner{
        customerCost = _price;
        emit priceUpdated(customerCost);
    }

    function updateRackPrice(uint _price) public onlyOwner{
        rackCost = _price;
        emit priceUpdated(customerCost);
    }
    
    function withdrawMoney() public onlyOwner{
        uint _balance = address(this).balance;
       (bool success, ) = owner().call{value: _balance}("");
        require(success, "Transfer failed.");
        emit withdrawStatus("True");
    }

    /********* View functions *********/

    //View Pricing
    function viewPrices() public view returns(uint _company, uint _customer, uint _rack){
        return (companyCost, customerCost, rackCost);
    }

    //Returns Stats
    function seeStats() public view onlyOwner returns(uint _companies, uint _customers, uint _racks){
        return (companiesIndex, customerIndex, rackIndex);
    }

    //Returns a company's customer index
    function seeCustomerIndex() public view returns(uint _customerIndex){
        address msgSender = _msgSender();
        require(msgSender == company[msgSender]._owner, "Not company owner");
        return company[msgSender]._customerIndex;
    }

    //Returns a company's customer info
    function seeCustomerInfo(uint _id) public view returns(string memory _customerName, uint _rackIndex){
        address msgSender = _msgSender();
        require(msgSender == company[msgSender]._owner, "Not company owner");
        return (company[msgSender]._customer[_id]._name,
        company[msgSender]._customer[_id]._rackIndex);
    }

    //Returns a company's customer's rack info
    function seeRackLocation(uint _idCustomer, uint _idRack) public view returns(string memory _rackName, address _rackAddress, string memory _pincode){
        address msgSender = _msgSender();
        require(msgSender == company[msgSender]._owner, "Not company owner");
        return (company[msgSender]._customer[_idCustomer]._rack[_idRack]._name, 
        company[msgSender]._customer[_idCustomer]._rack[_idRack]._where,
        company[msgSender]._customer[_idCustomer]._rack[_idRack]._pincode );
    }

    //Returns if company is created
    function isCompanyCreated() public view returns(bool _isItACompany){
        address msgSender = _msgSender();
        return msgSender == company[msgSender]._owner;
    }

}
